import React from "react";

const About = () => {
  return (
    <div>
      <h1>About this App</h1>
      <p className="my-1">A full stack react app for keeping contacts safe</p>
      <p className="bg-dark">
        <strong>Version: </strong> 1.0.0
      </p>
    </div>
  );
};

export default About;
